import React, { Component } from 'react';
import './login.css'

const Flag = false;
class App extends Component {

        constructor(props){
            super(props)
            this.handleSubmit = this.handleSubmit.bind(this);
        }
    state={
        tempUserName : null,
        tempUserPassword : null,
        UserName : null,
        UserPassword: null,
    }

    temp = (event) =>{
        const{
            value   
        } = event.target;
        this.setState({
            tempUserName : value
        },console.log("Name",this.state.tempUserName))
    }




  render() {
    return (
         <div className="login-page">
        <div className="form registered ">

            <form className=" login-form">
                <input type="text" value={this.state.tempUserName|| null} onChange={this.temp}  placeholder="user name"  />
                <input type="text" name="password" id="name" placeholder="password"/>
                <input type="button" value="LOGIN" className="btn"/>
                <p className="msg">Not Registered? <a href="#">Register</a></p>
            </form> 
        </div>
        </div>

    );
  }
}

export default App;
